import React from "react";
import Sidebar from "./compoments/Sidebar";

function Admin() {
  //  console.log("admin");
  return (
    <div className="d-flex justify-content-center">
      <div className="container row">
        <Sidebar />
        <div className="col">
          <h1>admin</h1>
        </div>
      </div>
    </div>
  );
}

export default Admin;
